import "./MusicPage.css";
import { useNavigate } from 'react-router-dom';

const MusicPage = () => {
  const navigate = useNavigate();
  const navigateToHome = () => {
    navigate("https://open.spotify.com/embed/track/5FQ9ZF8KtleowIW9t8nk9L?utm_source=generator");
  };
    return (
        <>
          {(
            
             
                <div id="space">
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="stars"></div>
                    <div className="welcome"> WELCOME TO My Music Portal</div>
                    <a href="https://open.spotify.com/embed/track/5FQ9ZF8KtleowIW9t8nk9L?utm_source=generator" target="_blank" rel="noreferrer">
                    <button type="button" className="box"> BEGIN</button>
                    </a>
                     
                </div>
                
              
            
          )}
        </>
    )
}

export default MusicPage
